import{BoweserRouter,Routes,Route} from 'react-router-dom'
import Home from '../src/pages/Home'
function App() {
  return (
    <div className="App">
      <BoweserRouter>
        <Routes>
          <Route exact path = '*' element={<Home/>}/>
        </Routes>
      </BoweserRouter>
    </div>
  );
}

export default App;
